INSERT INTO `m_setting` VALUES ('4', '0', 'KEY-CSKH-CSTD', '3', '4', 'THU ĐỔI KIM CƯƠNG THIÊN NHIÊN', '<div style=\"margin:7px 7px 7px 7px;\">Kim cương rời tr&ograve;n trắng dưới 2.5ly-Mix Clarity:<br />\r\n-&nbsp;Thu lại 70% gi&aacute; trị h&oacute;a đơn&nbsp;(Kh&ocirc;ng &aacute;p dụng đổi)<br />\r\n<br />\r\nKim cương rời m&agrave;u:<br />\r\n- Thu lại 80% gi&aacute; trị h&oacute;a đơn.<br />\r\n-&nbsp;Trường hợp đổi sản phẩm kh&aacute;c c&oacute; gi&aacute; trị lớn hơn sản phẩm cũ, thu lại 90% gi&aacute; trị h&oacute;a đơn.<br />\r\n<br />\r\nKim cương rời Fancy Shape:&nbsp;<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/table1.png\" style=\"width:100%\" /><br />\r\n<br />\r\nKim cương rời tr&ograve;n trắng-Clarity VVS1, VS:<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/table2.png\" style=\"width:100%\" /><br />\r\n<br />\r\nKim cương rời tr&ograve;n trắng-Clarity SI:<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/table3.png\" style=\"width:100%\" /><br />\r\n<br />\r\nKim cương rời mua trước ng&agrave;y 01/01/2010:<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/table4.png\" style=\"width:100%\" /><br />\r\n<br />\r\n<strong>Lưu &yacute;:<br />\r\n-&nbsp;</strong>Chế độ thu đổi, bảng gi&aacute; bảo h&agrave;nh c&oacute; thể thay đổi từng thời điểm.<br />\r\n-&nbsp;Tất cả c&aacute;c sản phẩm trang sức của PNJ được bảo h&agrave;nh v&agrave; thay đổi thống nhất tại hệ thống cửa h&agrave;ng trang sức PNJ tr&ecirc;n to&agrave;n quốc.<br />\r\n-&nbsp;<em>Để biết th&ecirc;m chi tiết về chương tr&igrave;nh hoặc xem điểm t&iacute;ch lũy qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể truy cập: www.pnj.com.vn. Hotline:&nbsp;(08) 39990 0990 - 1800 54 54 57</em></div>\r\n', null, null, '2', '2016-01-12 10:59:36', 'B&agrave;i viết thu đổi kim cương thi&ecirc;n nhi&ecirc;n nằm trong ch&iacute;nh s&aacute;ch thu đổi', 'thu-doi-kctn1452571176.png', '');
INSERT INTO `m_setting` VALUES ('5', '0', 'KEY-CSKH', '1', '5', 'CHÍNH SÁCH BẢO HÀNH', null, null, null, null, null, 'Menu Chính sách bảo hành nằm trong menu Chăm sóc khách hàng', null, null);
INSERT INTO `m_setting` VALUES ('6', '0', 'KEY-CSKH-CSBH', '5', '6', 'CHÍNH SÁCH BẢO HÀNH', '<br />\r\n- Bảo h&agrave;nh 6 th&aacute;ng lỗi kỹ thuật, nước xi.<br />\r\n- Bảo h&agrave;nh đ&aacute;nh b&oacute;ng, si&ecirc;u &acirc;m l&agrave;m sạch miễn ph&iacute;.<br />\r\n- Khắc chữ miễn ph&iacute;.<br />\r\n<br />\r\n* Chế độ thu đổi, bảng gi&aacute; bảo h&agrave;nh c&oacute; thể thay đổi t&ugrave;y từng thời điểm, kh&aacute;ch h&agrave;ng c&oacute; thể truy cập websiste&nbsp;<a href=\"http://www.pnj.com.vn\">http://www.pnj.com.vn</a>&nbsp;để biết th&ecirc;m th&ocirc;ng tin hoặc cập nhật chế độ thu đổi v&agrave; bảng gi&aacute; bảo h&agrave;nh hiện h&agrave;nh.<br />\r\n<br />\r\n* Tất cả c&aacute;c sản phẩm trang sức v&agrave;ng của PNJ được bảo h&agrave;nh v&agrave; thu đổi thống nhất tại hệ thống cửa h&agrave;ng trang sức v&agrave;ng PNJ tr&ecirc;n to&agrave;n quốc (kh&ocirc;ng thu đổi Trung T&acirc;m Thương Mại).', null, null, '2', '2015-12-28 17:01:32', 'B&agrave;i viết ch&iacute;nh s&aacute;ch bảo h&agrave;nh nằm trong ch&iacute;nh s&aacute;ch bảo h&agrave;nh', null, '');
INSERT INTO `m_setting` VALUES ('7', '0', 'KEY-CSKH-CSTD', '3', '7', 'THU ĐỔI TRANG SỨC KIM CƯƠNG', '<div style=\"margin:7px 7px 7px 7px\"><strong>1. Nữ trang kim cương VS, VVS dưới 4.0 ly, v&agrave; nữ trang kim cương SI c&aacute;c size, nữ trang &ldquo;Look like big&rdquo;:</strong><br />\r\n&nbsp;- Thu lại 80% trị gi&aacute; h&oacute;a đơn.<br />\r\n&nbsp;- Trường hợp đổi sản phẩm kh&aacute;c c&oacute; gi&aacute; trị lớn hơn sản phẩm cũ, thu lại 90% gi&aacute; trị h&oacute;a đơn.<br />\r\n<br />\r\n<strong>2. Nữ trang kim cương VS, VVS từ 4.0 ly trở l&ecirc;n, trang sức kim cương m&agrave;u</strong><br />\r\n&nbsp; - Đ&aacute; &aacute;p dụng tỷ lệ thu đổi như kim cương rời.<br />\r\n&nbsp; - Vỏ nữ trang &aacute;p dụng tỷ lệ thu đổi như mục số 5.<br />\r\n<br />\r\n<strong>Lưu &yacute;:</strong><br />\r\n-&nbsp;Chế độ thu đổi, bảng gi&aacute; bảo h&agrave;nh c&oacute; thể thay đổi từng thời điểm.<br />\r\n-&nbsp;Tất cả c&aacute;c sản phẩm trang sức của PNJ được bảo h&agrave;nh v&agrave; thay đổi thống nhất tại hệ thống cửa h&agrave;ng trang sức PNJ tr&ecirc;n to&agrave;n quốc.<br />\r\n-&nbsp;<em>Để biết th&ecirc;m chi tiết về chương tr&igrave;nh hoặc xem điểm t&iacute;ch lũy qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể truy cập: www.pnj.com.vn. Hotline:&nbsp;(08) 39990 0990 - 1800 54 54 57</em></div>\r\n', null, null, '2', '2016-01-28 14:42:10', 'B&agrave;i viết thu đổi trang sức kim cương nằm trong ch&iacute;nh s&aacute;ch thu đổi', 'thu-doi-trang-suc-kim-cuong1453966930.png', '');
INSERT INTO `m_setting` VALUES ('8', '0', 'KEY-KTKC', '2', '8', '4CS', null, null, null, null, null, 'Menu 4cs trong kiến thức kim cương', null, null);
INSERT INTO `m_setting` VALUES ('9', '0', 'KEY-KTKC-4CS', '8', '9', 'CUT', 'Cut l&agrave; ti&ecirc;u chuẩn quan trọng nhất của một vi&ecirc;n kim cương. Kim cương Round Brilliant Cut sẽ c&oacute; 57 gi&aacute;c cắt đối xứng ho&agrave;n hảo. Tất cả &aacute;nh s&aacute;ng đi v&agrave;o vi&ecirc;n kim cương đều phản chiếu đầy đủ l&ecirc;n bề mặt của n&oacute;, tạo n&ecirc;n vẻ đẹp rực rỡ của 7 sắc cầu vồng hay c&ograve;n gọi l&agrave; &quot;lửa&quot; của kim cương.<br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/Cut-1.png\" /><br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/cut-2.PNG\" /><br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/cut-3.PNG\" /><br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/cut-4.PNG\" /><br />\r\n&nbsp;', null, null, '2', '2015-12-17 11:46:37', 'B&agrave;i viết cut trong 4cs', 'iconcut1450327597.png', '');
INSERT INTO `m_setting` VALUES ('10', '0', 'KEY-KTKC-4CS', '8', '10', 'CARAT', 'Từ carat bắt nguồn từ thời cổ đại, l&agrave; đơn vị đo lường xuất xứ từ hạt của một loại c&acirc;y đậu (carob). Tr&aacute;i đậu c&oacute; c&aacute;c hạt gần như bằng nhau, những hạt n&agrave;y ng&agrave;y xưa được c&aacute;c nh&agrave; bu&ocirc;n b&aacute;n đ&aacute; qu&yacute; d&ugrave;ng để c&acirc;n kim cương. V&agrave;o năm 1913, trọng lượng carat được quốc tế chuẩn h&oacute;a v&agrave; được cho v&agrave;o hệ thống đo lường. Một carat bằng 0.2 gram. Trọng lượng của những vi&ecirc;n kim cương nhỏ thường được chia th&agrave;nh điểm (Point), với 1carat được chia th&agrave;nh 100 điểm (Point) . V&iacute; dụ 50 điểm (Point) l&agrave; c&aacute;ch n&oacute;i ngắn của nữa carat hay được viết l&agrave; 0.50.<br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/carat.PNG\" />', null, null, '2', '2015-12-17 14:01:09', 'B&agrave;i viết carat trong 4cs', 'iconcarat1450335669.png', '');
INSERT INTO `m_setting` VALUES ('11', '0', 'KEY-KTKC-4CS', '8', '11', 'CLARITY', 'Khi bạn cố gắng t&igrave;m những đặc điểm b&ecirc;n trong v&agrave; những dấu vết b&ecirc;n ngo&agrave;i của vi&ecirc;n kim cương tức l&agrave; bạn đang ph&acirc;n cấp độ tinh khiết cho vi&ecirc;n kim cương đ&oacute;. Độ tinh khiết l&agrave; số lượng những vết t&iacute;ch b&ecirc;n ngo&agrave;i gọi l&agrave; blemishes (tỳ vết b&ecirc;n ngo&agrave;i) v&agrave; những đặc điểm b&ecirc;n trong gọi l&agrave; inclusions (bao thể b&ecirc;n trong).<br />\r\n<br />\r\nC&oacute; nhiều hệ thống ph&acirc;n cấp độ tinh khiết kh&aacute;c nhau tr&ecirc;n thế giới. PNJLab ph&acirc;n cấp độ tinh khiết dựa tr&ecirc;n quan điểm của GIA (viện ngọc học Hoa Kỳ).<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/clarity%281%29.PNG\" style=\"height:100%; width:100%\" />', null, null, '2', '2015-12-17 14:01:24', 'B&agrave;i viết clarity trong 4cs', 'iconclarity1450335684.png', '');
INSERT INTO `m_setting` VALUES ('12', '0', 'KEY-KTKC-4CS', '8', '12', 'COLOR', 'Đối với kim cương trắng, m&agrave;u sắc cố thể ph&acirc;n ra nhiều cấp độ từ kh&ocirc;ng m&agrave;u đến m&agrave;u v&agrave;ng nhạt v&agrave; vi&ecirc;n kim cương c&agrave;ng trắng th&igrave; c&agrave;ng hiếm v&agrave; gi&aacute; trị c&agrave;ng cao.<br />\r\n<br />\r\nTrong bảng xếp loại m&agrave;u kim cương trắng của GIA ( Viện Ngọc Học Hoa Kỳ ) v&agrave; PNJLab , m&agrave;u trắng của kim cương bắt đầu từ k&yacute; tự D, E, F ... cho loại trắng kh&ocirc;ng m&agrave;u v&agrave; xếp dần xuống Z.<br />\r\n<br />\r\nC&aacute;ch tốt nhất để thấy được m&agrave;u sắc thật sự của một vi&ecirc;n kim cương l&agrave; nh&igrave;n n&oacute; đối diện với một mặt phẳng m&agrave;u trắng.<br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/Color.png\" />', null, null, '2', '2015-12-17 14:01:37', 'B&agrave;i viết color trong 4cs', 'iconcolor1450335697.png', '');
INSERT INTO `m_setting` VALUES ('13', '0', 'KEY-KTKC', '2', '13', 'CERTIFICATE', null, null, null, null, null, 'Menu certificate trong kiến thức kim cương', null, null);
INSERT INTO `m_setting` VALUES ('14', '0', 'KEY-KTKC-CERTIFICATE', '13', '14', 'CERTIFICATE', 'Nếu 4C(Cut-Carat-Clarity-Color) l&agrave; thước đo gi&aacute; trị của 1 vi&ecirc;n kim cương th&igrave; Certificate - Giấy chứng nhận l&agrave; bằng chứng để x&aacute;c thực c&aacute;c gi&aacute; trị n&agrave;y. Giấy chứng nhận bao gồm những th&ocirc;ng số ch&iacute;nh về trọng lượng, k&iacute;ch thước, độ tinh khiết, gi&aacute;c cắt v&agrave; m&agrave;u sắc, b&ecirc;n cạnh đ&oacute; l&agrave; những th&ocirc;ng tin về h&igrave;nh d&aacute;ng, sự c&acirc;n xứng, tỉ lệ cắt m&agrave;i của một vi&ecirc;n kim cương do một tổ chức c&oacute; chuy&ecirc;n m&ocirc;n, chứng nhận quốc tế về chất lượng gi&aacute;m định cấp. Kiếm định kim cương PNJ được thực hiện bởi PNJLab - C&ocirc;ng ty gi&aacute;m định chuy&ecirc;n nghiệp v&agrave; độc lập (kh&ocirc;ng kinh doanh kim cương), tu&acirc;n thủ theo những quy định v&agrave; chuẩn mực gắt gao nhất về kiểm định kim cương của GIA từ ban đầu.<br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/2%281%29.png\" /><br />\r\n<br />\r\nPNJ chỉ chọn những vi&ecirc;n kim cương c&oacute; chất lượng ho&agrave;n hảo, được kiểm định bởi c&ocirc;ng ty PNJLab, theo ti&ecirc;u chuẩn nghi&ecirc;m ngặt nhất của GIA - Viện Ngọc Học Hoa Kỳ<br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/3%281%29.png\" /><br />\r\nL&agrave; một c&ocirc;ng ty ti&ecirc;n phong v&agrave; uy t&iacute;n h&agrave;ng đầu trong lĩnh vực kinh doanh trang sức v&agrave; kim cương tại Việt Nam, để đ&aacute;p ứng nhu cầu của kh&aacute;ch h&agrave;ng cần một sự gi&aacute;m định ch&iacute;nh x&aacute;c v&agrave; tin cậy về chất lượng của kim cương, PNJ đ&atilde; th&agrave;nh lập C&ocirc;ng ty TNHH MTV Gi&aacute;m Đinh PNJ (PNJLab) từ rất sớm, được đầu tư hệ thống trang thiết bị v&agrave; c&ocirc;ng nghệ hiện đại theo ti&ecirc;u chuẩn GIA c&ugrave;ng với đội ngũ những chuy&ecirc;n gia kiểm định h&agrave;ng đầu, được đ&agrave;o tạo chuy&ecirc;n nghiệp bởi GIA v&agrave; c&oacute; bằng đại học/cao học chuy&ecirc;n ng&agrave;nh đ&aacute; qu&yacute;, ngọc học.<br />\r\nPNJLab c&ograve;n l&agrave; c&ocirc;ng ty đầu ti&ecirc;n v&agrave; duy nhất tạ Việt Nam đạt. ti&ecirc;u chuản ISO/IEC 17025:2005 - VILAS 565 trong kiểm định kiem cương v&agrave; đ&aacute; qu&yacute; - ngang bằng với chất lượng kiểm định của c&aacute;c c&ocirc;ng ty quốc tế.<br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/4%281%29.png\" /><br />\r\n&nbsp;<br />\r\nĐến thời điểm hiện tại PNJLab đ&atilde; trở th&agrave;nh một c&ocirc;ng ty kiểm định hoặt động độc lập, chuy&ecirc;n nghiệp v&agrave; uy t&iacute;n h&agrave;ng đầu Việt Nam. Theo ti&ecirc;u chuẩn gắt gao nhất về chất lượng kiểm định của GIA, dịch vụ v&agrave; giấy kiểm định do PNJLab cấp lu&ocirc;n được kh&aacute;ch h&agrave;ng v&agrave; đối t&aacute;c tin tưởng trong kinh doanh v&agrave; trao đổi kim cương, được sử dụng phổ biến tr&ecirc;n to&agrave;n l&atilde;nh thổ Việt Nam<br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/5%281%29.png\" />', null, null, '2', '2015-11-18 14:36:09', 'B&agrave;i viết certificate trong menu certificate', null, null);
INSERT INTO `m_setting` VALUES ('15', '0', 'KEY-KTKC', '2', '15', 'CÂU CHUYỆN KIM CƯƠNG', null, null, null, null, null, 'Menu Câu chuyện kim cương trong Kiến thức kim cương', null, null);
INSERT INTO `m_setting` VALUES ('17', '0', 'KEY-KTKC-CCKC', '15', '16', 'NHỮNG ĐIỀU CÂN NHẮC KHI MUA KIM CƯƠNG', '<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/banner-1a%281%29.png\" /><br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/content-1a-text.png\" /><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;', null, null, '2', '2016-01-05 14:04:44', 'NHỮNG ĐIỀU C&Acirc;N NHẮC KHI MUA KIM CƯƠNG', 'banner-11451889400.png', 'Nội dung ngắn 1 Nội dung ngắn 1');
INSERT INTO `m_setting` VALUES ('18', '0', 'KEY-KTKC-CCKC', '15', '17', 'LÀM SAO ĐỂ PHÂN BIỆT KIM CƯƠNG THẬT VÀ GIẢ', '<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/banner-2a.png\" /><br />\r\n<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/content-2a-text.png\" />', null, null, '2', '2016-01-04 18:59:33', 'L&Agrave;M SAO ĐỂ PH&Acirc;N BIỆT KIM CƯƠNG THẬT V&Agrave; GIẢ', 'banner-21451908773.png', '');
INSERT INTO `m_setting` VALUES ('19', '0', 'KEY-KTKC', '2', '18', 'QA', null, null, null, null, null, 'Menu QA trong kiến thức kim cương', null, null);
INSERT INTO `m_setting` VALUES ('20', '0', 'KEY-KTKC-QA', '18', '19', 'Mua kim cương như thế nào để có lợi nhất?', 'Bạn nên mua kim cương phù hợp với nhu cầu, túi tiền, giá cả hợp lý, mua kim cương\r\nở các công ty có sự đảm bảo về chất lượng thông qua các giấy kiểm định uy tín, có\r\nchính sách kinh doanh minh bạch, chế độ thu đổi cạnh tranh để dễ bán lại khi cần\r\nmà không bị mất giá nhiều.Bạn có thể tham khảo thêm những câu hỏi và trả lời bên\r\ndưới để có thể giải đáp những thắc mắc của riêng mình.', null, null, '2', '2015-11-13 11:15:07', '', null, null);
INSERT INTO `m_setting` VALUES ('21', '0', 'KEY-KTKC-QA', '18', '20', 'Cần cân nhắc những gì khi mua kim cương?', '- Thấu hiểu nhu cầu của bản th&acirc;n trước khi mua kim cương.<br />\r\n- Khi đ&atilde; quyết định mua th&igrave; h&atilde;y chọn đ&uacute;ng thương hiệu c&oacute; uy t&iacute;n, đặt niềm tin v&agrave;o<br />\r\nthương hiệu v&agrave; hiểu r&otilde; về sản phẩm muốn mua.<br />\r\n- Khi c&acirc;n nhắc việc mua sản phẩm, bạn n&ecirc;n lựa chọn sản phẩm ph&ugrave; hợp với ng&acirc;n<br />\r\ns&aacute;ch v&agrave; t&igrave;nh h&igrave;nh t&agrave;i ch&iacute;nh hiện tại.<br />\r\n- Nắm r&otilde; những nguy&ecirc;n tắc v&agrave;ng &ldquo;4Cs v&agrave; hơn thế&rdquo; trong việc chọn lựa những sản<br />\r\nphẩm kim cương như &yacute;.<br />\r\n- Giấy gi&aacute;m định uy t&iacute;n.<br />\r\n- Sự thuận tiện, ch&iacute;nh s&aacute;ch minh bạch v&agrave; chế độ thu đổi cạnh tranh, linh hoạt.<br />\r\nKim cương rất phổ biến, được ti&ecirc;u chuẩn h&oacute;a v&agrave; c&oacute; khả năng trao đổi cao. V&igrave; vậy,<br />\r\nbạn cũng n&ecirc;n đề ph&ograve;ng những chi&ecirc;u thổi phồng một đặc t&iacute;nh n&agrave;o đ&oacute; của kim cương<br />\r\n(để che đậy c&aacute;c khuyết điểm kh&aacute;c), hoặc c&aacute;c chi&ecirc;u khuyến m&atilde;i gi&aacute; trị lớn (nhờ việc<br />\r\nđẩy gi&aacute; l&ecirc;n qu&aacute; cao). Khi mua những sản phẩm kim cương như vậy, th&ocirc;ng thường<br />\r\nbạn sẽ bị phụ thuộc nhiều v&agrave;o nơi b&aacute;n v&agrave; hy sinh c&aacute;c yếu tố kh&aacute;c. V&igrave; vậy đừng qu&ecirc;n<br />\r\nd&agrave;nh th&ecirc;m thời gian để so s&aacute;nh quy c&aacute;ch v&agrave; gi&aacute; cả tại c&aacute;c trung t&acirc;m kim ho&agrave;n c&oacute; uy<br />\r\nt&iacute;n trước khi quyết định mua.', null, null, '2', '2015-11-13 11:16:34', '', null, null);
