INSERT INTO `m_setting` VALUES ('38', '0', 'KEY-KTKC-QA', '18', '35', 'Vì sao kim cương cùng kích thước và màu sắc lại có giá thành khác nhau?', 'Có lẽ bạn chưa cân nhắc đến các yếu tố quan trọng khác là: giác cắt, độ tinh khiết và\r\ngiấy chứng nhận. Hãy nhớ cân nhắc đầy đủ các yếu tố khi so sánh giá trị kim cương.\r\nCũng không loại trừ khả năng bạn phải trả giá cao hơn vì viên kim cương được bán\r\nkèm theo một món hàng “khuyến mãi” khác.', '2', '2015-10-21 10:18:38', '2', '2015-11-13 11:20:26', '', null, null);
INSERT INTO `m_setting` VALUES ('39', '0', '', null, '36', '', '<strong>Đối với kim cương trắng</strong>, m&agrave;u sắc cố thể ph&acirc;n ra nhiều cấp độ từ kh&ocirc;ng m&agrave;u đến m&agrave;u v&agrave;ng nhạt v&agrave; vi&ecirc;n kim cương c&agrave;ng trắng th&igrave; c&agrave;ng hiếm v&agrave; gi&aacute; trị c&agrave;ng cao. Trong bảng xếp loại m&agrave;u kim cương trắng của GIA ( Viện Ngọc Học Hoa Kỳ ) v&agrave; PNJLab , m&agrave;u trắng của kim cương bắt đầu từ k&yacute; tự D, E, F ... cho loại trắng kh&ocirc;ng m&agrave;u v&agrave; xếp dần xuống Z. C&aacute;ch tốt nhất để thấy được m&agrave;u sắc thật sự của một vi&ecirc;n kim cương l&agrave; nh&igrave;n n&oacute; đối diện với một mặt phẳng m&agrave;u trắng.<br />\r\n<img alt=\"\" src=\"http://210.211.121.139/pnj-service/ckupload/files/cut.PNG\" style=\"height:441px; width:450px\" /><br />\r\n<br />\r\n&nbsp;', '2', '2015-10-21 15:13:49', '2', '2015-10-22 10:08:18', '', null, null);
