INSERT INTO `m_setting` VALUES ('44', '0', 'KEY-KTKC-QA', '18', '41', 'Mua kim cương nơi nào bảo đảm nhất?', 'N&ecirc;n mua từ những nơi uy t&iacute;n l&acirc;u năm, đơn giản v&igrave; họ sẽ kh&ocirc;ng bao giờ hy sinh uy t&iacute;n<br />\r\nchỉ v&igrave; lợi nhuận của một vi&ecirc;n kim cương. Những c&ocirc;ng ty c&oacute; đội ngũ tư vấn chuy&ecirc;n<br />\r\nnghiệp, thiết bị kiểm tra đầy đủ, hệ thống cửa h&agrave;ng, thu mua rộng khắp v&agrave; tỉ lệ thu<br />\r\nmua trao đổi minh bạch cũng l&agrave; yếu tố để bạn quyết định mua.', '2', '2015-11-13 11:17:01', '2', '2015-11-13 11:19:46', '', null, null);
INSERT INTO `m_setting` VALUES ('45', '0', 'KEY-KTKC-QA', '18', '42', 'Làm sao để biết một viên kim cương là thật hay giả?', 'Rất khó để nhận biết bằng mắt thường ngay cả khi bạn có kinh nghiệm lâu năm trong\r\nnghề. Thông thường, nếu là kim cương có giá trị cao sẽ được giám định trước. Để an\r\ntâm khi mua kim cương bạn nên đến các cửa hiệu uy tín, đã hoạt động lâu năm, có\r\nnhững thiết bị kiểm tra cho khách hàng xem như bút thử kim cương, máy soi mã số\r\ncạnh… Bạn cũng có thể tìm đến các trung tâm kiểm định đá quý có uy tín để được tư\r\nvấn và hướng dẫn chọn được các sản phẩm có chất lượng tốt nhất. Hiện tại PNJLab\r\nđã có chương trình tư vấn miễn phí cho người tiêu dùng với đội ngũ chuyên viên kiểm\r\nđịnh chuyên nghiệp.', '2', '2015-11-13 11:20:43', null, null, '', null, null);
INSERT INTO `m_setting` VALUES ('46', '0', 'KEY-KTKC-QA', '18', '43', 'Có phải mọi giấy chứng nhận kim cương đều có giá trị như nhau?', 'Chỉ có giấy chứng nhận kim cương được cấp bởi các công ty/tổ chức có chuyên môn\r\ngiám định uy tín mới có giá trị. Công ty/tổ chức giám định uy tín phải có đội ngũ\r\nchuyên viên kiểm định được đào tạo chuyên nghiệp cùng với các thiết bị chuyên\r\ndụng, hiện đại hỗ trợ, được cấp phép hoạt động trong lĩnh vực giám định đá quý và\r\nhoạt động theo các tiêu chuẩn được các tổ chức kiểm soát, đo lường chất lượng công\r\nnhận (tiêu chuẩn ISO/IEC - UILAS…). Khi đảm bảo được những yêu cầu trên thì mới\r\nđảm bảo chất lượng của giấy kiểm định là chính xác. PNJLab còn là công ty đầu tiên\r\nvà duy nhất tại Việt Nam đạt tiêu chuẩn ISO/IEC 17025:2005 – VILAS 565 trong kiểm\r\nđịnh kim cương và đá quý – ngang bằng với chất lượng kiểm định của các công ty\r\nquốc tế.', '2', '2015-11-13 11:21:15', null, null, '', null, null);
INSERT INTO `m_setting` VALUES ('47', '0', 'KEY-KTKC-QA', '18', '44', 'Kim cương có giấy chứng nhận có đắt hơn không?', 'Giấy chứng nhận khẳng định chất lượng của vi&ecirc;n kim cương bạn đang sở hữu. Chi<br />\r\nph&iacute; gi&aacute;m định kh&ocirc;ng cao v&agrave; c&oacute; thể được cộng v&agrave;o gi&aacute; b&aacute;n nhưng n&oacute; chỉ chiếm tỉ lệ<br />\r\nrất nhỏ so với gi&aacute; trị vi&ecirc;n kim cương v&agrave; được xem l&agrave; tờ &ldquo;giấy th&ocirc;ng h&agrave;nh&rdquo; ch&iacute;nh thức<br />\r\nđể một vi&ecirc;n kim cương đến tay người ti&ecirc;u d&ugrave;ng.', '2', '2015-11-13 11:22:43', null, null, '', null, null);
INSERT INTO `m_setting` VALUES ('48', '0', 'KEY-KTKC-QA', '18', '45', 'Mua nữ trang kim cương PNJ có giấy chứng nhận không?', 'Hầu hết nữ trang gắn kim cương từ 4.0 mm trở l&ecirc;n tại PNJ đều c&oacute; giấy kiểm định kim<br />\r\ncương. T&ugrave;y từng sản phẩm, sẽ c&oacute; sản phẩm c&oacute; cả 2 giấy kiểm định kim cương PNJ v&agrave;<br />\r\nGIA hoặc l&agrave; chỉ c&oacute; 1 trong 2 loại giấy kiểm định PNJ hoặc GIA. C&aacute;c sản phẩm trang<br />\r\nsức kim cương kh&ocirc;ng c&oacute; giấy kiểm định sẽ c&oacute; khắc chất lượng kim cương tr&ecirc;n đai<br />\r\nsản phẩm.', '2', '2015-11-13 11:24:30', null, null, '', null, null);
